    uv = (uv_orig-0.5)*2.0;
    float angle = atan(uv.y,uv.x);
    float radius = length(uv);

    // Create pulsing spiral pattern
    float spiral = sin(angle*5.0 + radius*20.0 - time*2.0);
    float pulse = 0.5 + 0.5*sin(time*1.5 + radius*10.0);

    // Color cycling
    vec3 col;
    col.r = 0.7 + 0.3*sin(time*0.7 + angle + spiral);
